registerCustomToken("customPath", (ctx) => {
  const parts = ctx.noteFolderPath.split("/");
  const root = parts[0];
  if (root === "Notes") {
    const name = parts[1]; 
    const subTree = parts.slice(2).join("/");  
    const fileName = ctx.noteFileName;
    return subTree
      ? `Notes/${name}/assets/${subTree}/${fileName}`
      : `Notes/${name}/assets/${fileName}`;
  }
  if (root) {
    const subTree = parts.slice(1).join("/");
    const fileName = ctx.noteFileName;
    return subTree
      ? `${root}/assets/${subTree}/${fileName}`
      : `${root}/assets/${fileName}`;
  }
  return `assets/${ctx.noteFileName}`;
});
